      >
        <Image width="100%" height="120px" />
        <Image width="100%" height="120px" />
        <Image width="100%" height="120px" />
      </Grid>
    </Grid>
  );
};

const Count = styled.div`
  width: 20px;
  height: 20px;
  border-radius: 10px;
  background: rgb(${(props) => props.theme.palette.D_yellow});
  font-size: 12px;
  text-align: center;
  line-height: 20px;
`;

export default Gallery;
